#include "informationRegister.h"

/* PNG */
static const wxString s_informationRegister_16_png = wxT("");

wxIcon CValueMetaObjectInformationRegister::GetIcon() const
{
	return GetIconGroup();
}

wxIcon CValueMetaObjectInformationRegister::GetIconGroup()
{
	static wxIcon icon =
		CBackendPicture::GetIconFromBase64(s_informationRegister_16_png, wxSize(16, 16));

	return icon;
}
